import React ,{useEffect,useState}from "react";
import Code from "../components/Code";

const CodeBlockPage2 = () => {
    const [code, setCode] = useState("");
    const id = "2";

  useEffect(()=>{
    //http request to get code from backend - once 
    fetch(`http://localhost:5000/code/${id}`)
    .then((res) => res.json())
    .then((data) => {
      setCode(data.code);
    })
    .catch((err) => console.log(err));
  },[])

  return (
    <div>
      {code !== "" && <Code code={code} id={id} />}
    </div>
  );
};

export default CodeBlockPage2;
